import { Link } from "react-router-dom";


const CardCountry = ({name, continent, image, id}) => {
    return(
        <div>
            <Link to={`/countries/${id}`}>
            <img src={image} alt={name} style={ {borderRadius: '99999rem'} }/>
            </Link>
            <h1>{name}</h1>
            <p>{continent}</p>
        </div>
    )
}

export default CardCountry;
